  input: "\"TEXT\",\"F3XN\",\"C00143743\",\"October 11, 2005    Mr. Bradley Decker
    \ Federal Election Commission  Washington, DC 20463    RE:\t\t\t\tRepublican Party
    of Texas  Identification Number:\tC00143743  Report:\t\t\t\tAmended June Monthly
    Report\t\t\t\t\t\t\t\t(May 1, 2005 - May 31, 2005)    Filed\t\t\t\tJune 20, 2005
    \   Dear Mr. Decker:    Pursuant to your letter dated, September 9, 2005, regarding
    the Amended June Monthly Report, we are responding to each item (as listed below).
    \   1).\tBeginning Cash Total - has been amended to reflect the ending balance
    on the Amended May 2005 Report as filed on 09/02/05.  2).\tRegarding 11 CFR #
    104.3(a)(4)(i), Identification for an individual who contributes more than $200,
    The Republican Party of Texas follows the following procedure to obtain this information.
    \ The Party first requests this information on the original solicitation in a
    clear and conspicuous manner.  The request informs the contributor of the requirements
    of federal law in reporting this information.  If the individual doesnt provide
    the information with their contribution, we follow up with a letter mailed to
    the individual requesting this information in clear manner.  The letter is sent
    with a return envelop provided for them.  These procedures are designed to demonstrate
    our best efforts to obtain information required by the Commission.  We have sent
    a sample copy of a solicitation mail piece and the follow up letter used by the
    Republican Party of Texas under separate cover.  When information is returned,
    our database is amended and the information is reported.  3).\tThe Contribution
    from Potts & Reilly, L.L.P. reported on Line 11a in the amount of $7,870.90 was
    in error.  This contribution was paid with state funds for state activities.  The
    entry was coded incorrectly and has been removed.  It does not require disclosure.
    \ 4).\tOn Schedule D the outstanding balance at the close of the Amended May Report
    was $939.33, therefore, the Amended June Report is correct and therefore, no action
    is necessary.  5).\tSchedule B regarding the Transfer of Allocated Funds is a
    transfer from the non-federal accounts to our Federal account for its ratio of
    allocated expenditures.  It is not a transfer from one federal account to another.
    \ This is in response to a letter from the FEC on the September 2004 Report requesting
    the transfer of these funds to the non-federal account.    \tOn Schedule H3, the
    software was not recording the name of the account, but picking up the address
    line field 900 Congress Ave.  We have amended the name of the account to correctly
    reflect the transfer from a non-federal account to a federal account.  6).\tSchedule
    B and H4 expenditures for BRM Postage Deposit Non-FEA and Event Planning Consultant
    - Non Employee and Campaign Training Event Room Rental have been amended.  These
    expenses are for the Republican Party of Texas generic fundraising drives or party
    activities including State Party Campaign Training Schools and are not for any
    specific candidate mailing.  These expenditures do not constitute in-kind contributions
    on behalf of any specific candidate.  All expenditures are reviewed carefully
    to identify specific reporting requirements and to identify any expenditure that
    meets the definition of a Federal Election Activity or express advocacy activity.
    \ 7).\tRegarding Schedule B reimbursement payments to staff for travel expenses;
    we have amended the report with memo entries to disclose the expenditures as required.
    \ 8).\tRegarding Schedule H4 reimbursements to staff for office supplies, we have
    amended the report with memo entries to disclose the expenditure as required.
    \  Best regards,  Christopher Maska, Treasurer  The Republican Party of Texas\""
